import React from 'react';
import {MainItems,SubItems} from '../data/NavbarItems';
export default function Navbar(){
console.log(MainItems)

    return(

        <div class="w3-top">
        <div class="w3-bar w3-black w3-card">
          <a class="w3-bar-item w3-button w3-padding-large w3-hide-medium w3-hide-large w3-right" href="javascript:void(0)" title="Toggle Navigation Menu"><i class="fa fa-bars"></i></a>
   {MainItems.map((item)=>{
    return(
<a href="#" class="w3-bar-item w3-button w3-padding-large">{item.name}</a>
    )
   })}


          <div class="w3-dropdown-hover w3-hide-small">
            <button class="w3-padding-large w3-button" title="More">USER<i class="fa fa-caret-down"></i></button>     
            <div class="w3-dropdown-content w3-bar-block w3-card-4">
            {SubItems.map((item)=>{
    return(
        <a href="#" class="w3-bar-item w3-button">{item.name}</a>
    )
   })}
            </div>
          </div>
          <a href="javascript:void(0)" class="w3-padding-large w3-hover-red w3-hide-small w3-right"><i class="fa fa-search"></i></a>
        </div>
      </div>
    )
}
